This PR adds `HTTPCache` feature. `HTTPCache` caches data on HTTP Server. User can use bearer token's path by passing `bearer_token_path` or `PFIO_HTTP_BEARER_TOKEN_PATH` environment variable. The cache will check its bearer token file automatically to support rotation of token.

The HTTP Server should support following operations. This PR also adds sample HTTP server implementation `OnMemoryHTTPServerForTest` in `pfio/testing/__init__.py`.

- GET {user-given-url}/{integer}
- PUT {user-given-url}/{integer}

